message:
A designação comercial Made in Germany. Feito na Alemanha) era obrigatório na Inglaterra desde 1887 para mercadorias do Reichsdeutsche importadas para o domínio inglês (Merchandise Marks Act). Esta marcação legalmente prescrita foi oficialmente destinada a proteger os ingleses de artigos importados supostamente inferiores. No entanto, um boicote indireto aos produtos alemães do Reich também deveria ser alcançado a fim de estigmatizá-los e garantir a supremacia econômica da Inglaterra. O oposto era o caso, no entanto, porque, como rapidamente se tornou aparente, a qualidade dos produtos alemães era boa, muitas vezes até melhor do que a dos ilhéus. Made in Germany tornou-se assim o epítome da qualidade em todo o mundo e ainda hoje é um selo de qualidade. De acordo com um estudo internacional de 2017, o Made in Germany goza de grande reputação internacional e ocupa o primeiro lugar entre 52 países no Índice Made in Country.

